import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Gextension from './Gameextension';


class Game extends React.Component{
    constructor(props){
        super(props);
        this.state={
            value: 'name',
            name : <Gextension name="daim" address=" Glasgow, United Kingdom" />
        }
    }

    render(){
        return(
            <div>
                <h1>
                    {this.state.name}
                </h1>
            </div>
        )
    }
}

export default Game;
